// name: VE.Direct to JSON
// outputs: 1
// inputs: 1 serial node, split input "on the character" "\n"
// and deliver "binary buffers"

var block = context.get('block') || "{";
var checksum = context.get('checksum') || 0;

var fieldBuffer = msg.payload;
var fieldLenght = fieldBuffer.length;

var field = fieldBuffer.toString();
field = field.replace(/\r?\n?/g, '');
field = field.split("\t");

// Drop null fields
if (field[0] === "") {
//    node.warn("NULL field dropped!");
    return null;
}

if (field[0] === "OR") {
    field[1] = parseFloat((field[1]).substr(7));
}

// Remove HEX messages and add CR+LF for checksum
if (field[0] == "Checksum" && field[1].length > 1) {
    fieldLenght = 12;
    fieldBuffer[10] = 0xd;
    fieldBuffer[11] = 0xa;
//    node.warn("HEX message stripped!");
}

for (var i = 0; i < fieldLenght; i++) {
    checksum -= fieldBuffer[i];
}

checksum = checksum & 0xff;

if (field[0] == "Checksum") {

    context.set('checksum', null);
    context.set('block', null);

    if (checksum === 0) {
        block = block += "}";
        msg.payload = JSON.parse(block);
        return msg;
    } else {
//        node.warn('Checksum failed!')
        return null;
    }
}

if (block.length > 1) {
    block = block += ",";
}

block = block += "\"" + field[0] + "\"" + ":";

// PID and FW values detected incorrectly as number
var isANumber = isNaN(field[1]) === false;
if (isANumber && (field[0] !== "PID") && (field[0] !== "FW")) {
//    block = block += "\"" + field[1] + "\"";
    block = block += field[1];
} else {
//    block = block += field[1];
    block = block += "\"" + field[1] + "\"";
}

context.set('checksum', checksum);
context.set('block', block);

const re = /^temp=(.*)'C$/gm;
msg.payload = Number(msg.payload.replace(re, '$1'));
return msg;

msg.response = msg.payload;
let index_begin = msg.payload.indexOf(':');
let index_end = msg.payload.indexOf('\n');
let res = msg.payload.substring(index_begin, index_end);
node.warn(res);
msg.parsed = {};

let code = +res[1];

let calculated_checksum = code;
for (let i = 2; i<res.length; i += 2) {
    calculated_checksum += parseInt(res.slice(i, i+2), 16)
}
if ((calculated_checksum & 0x55) != 0x55) {
    throw "Checksum missmatch"
}

// If code is get or set, check flag byte for issues
if (7 <= code <= 8) {
    switch (parseInt(res[7], 16)) {
        case 0x01:
            throw "Unknown ID";
        case 0x02:
            throw "Trying to write to read only value";
        case 0x04:
            throw "Parameter error (out of range)"
    }
}

let data_low = res[8]+res[9];
// two byte response
let data_high = 0;
if (res.length > 12) {
    data_high = res[10]+res[11];
}

msg.parsed.code = code
msg.parsed.data = parseInt(data_high + data_low, 16);
msg.payload = msg.parsed.data;

return msg;

if (msg.topic == undefined) {
    throw "msg.topic must be defined";
}

let command = `:${msg.topic}`;
if (msg.register) {
    command += `${msg.register}00`;
    if (msg.payload) {
        if (typeof msg.payload != "number") {
            throw "Payload must be a number";
        }
        let payload = msg.payload.toString(16).padStart(4, "0").toUpperCase();
        if (payload.length > 4) throw "Invalid payload";
        payload = payload.slice(2) + payload.slice(0,2);
        command += payload;
    }
}

let byte_sum = +command[1];
for (let i = 2; i<command.length; i += 2) {
    byte_sum += parseInt(command.slice(i, i+2), 16)
}

let checksum = (0x155 - (byte_sum & 0xff)) & 0xff;
let checksum_string = checksum.toString(16).padStart(2, "0");

command += checksum_string;
msg.payload = command.toUpperCase();

return msg;

